import { Document } from "@govtechsg/decentralized-renderer-react-components";

export interface SUSSTemplateCertificate extends Document {
  name: string;
  description: string;
  issuedOn: string;
  admissionDate: string;
  graduationDate: string;
  recipient: {
    name: string;
    nric: string;
    course: string;
  };
  transcript: {
    name: string;
    grade: string;
    courseCredit: string;
    courseCode: string;
    examinationDate: string;
    semester: string;
  }[];
  additionalData: {
    merit: string;
    studentId: string;
    transcriptId: string;
    certSignatories: {
      signature: string;
      name: string;
      position: string;
      organisation: string;
    }[];
  };
}

